package com.kurgan.kursach.models;import lombok.*;import javax.persistence.*;import java.sql.Timestamp;@Entity@Table(name = "cars")@Setter@Getter@ToString@AllArgsConstructor@NoArgsConstructorpublic class Car {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    public Long car_id;    public String number;    public String brand;    public String model;    @ManyToOne    @JoinTable(name = "user_car", joinColumns = @JoinColumn(name = "car_id", referencedColumnName = "car_id"),            inverseJoinColumns = @JoinColumn(name = "user_id", referencedColumnName = "user_id"))    private User user;    @ManyToOne    @JoinTable(name = "car_parking", joinColumns = @JoinColumn(name = "car_id", referencedColumnName = "car_id"),            inverseJoinColumns = @JoinColumn(name = "parking_id", referencedColumnName = "parking_id"))    private Parking parking;    private Timestamp date;}